webpackJsonp([0xb82859240a73280],{"./node_modules/json-loader/index.js!./.cache/json/javascript-with.json":function(n,a){n.exports={data:{markdownRemark:{html:'<h2>With</h2>\n<p>JavaScript’s <code>with</code> statement is a shorthand way for editing several properties on one object. Most developers discourage usage of <code>with</code>, and you are best not using this keyword.</p>\n<p><strong>Note</strong>: <code>"strict mode"</code> forbids usage of <code>with</code>.</p>\n<h3>Syntax</h3>\n<div class="gatsby-highlight">\n      <pre class="language-syntax"><code>with (expression)\n  statement</code></pre>\n      </div>\n<h3>Example Usage</h3>\n<p>In JavaScript, you can individually modify an object’s properties like below:</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code><span class="token keyword">let</span> earth <span class="token operator">=</span> <span class="token punctuation">{</span><span class="token punctuation">}</span><span class="token punctuation">;</span>\nearth<span class="token punctuation">.</span>moons <span class="token operator">=</span> <span class="token number">1</span><span class="token punctuation">;</span>\nearth<span class="token punctuation">.</span>continents <span class="token operator">=</span> <span class="token number">7</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p><code>with</code> gives you a shorthand to modify the properties on an object:</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code><span class="token keyword">with</span> <span class="token punctuation">(</span>earth<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n  moons <span class="token operator">=</span> <span class="token number">1</span><span class="token punctuation">;</span>\n  continents <span class="token operator">=</span> <span class="token number">7</span><span class="token punctuation">;</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<p>While this example is contrived, you can understand use cases of <code>with</code> more if you have larger objects like below:</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code>earth<span class="token punctuation">.</span>continents<span class="token punctuation">.</span>australia<span class="token punctuation">.</span>geography<span class="token punctuation">.</span>ocean <span class="token operator">=</span> <span class="token string">"Pacific"</span><span class="token punctuation">;</span>\nearth<span class="token punctuation">.</span>continents<span class="token punctuation">.</span>australia<span class="token punctuation">.</span>geography<span class="token punctuation">.</span>river <span class="token operator">=</span> <span class="token string">"Murray"</span><span class="token punctuation">;</span>\nearth<span class="token punctuation">.</span>continents<span class="token punctuation">.</span>australia<span class="token punctuation">.</span>geography<span class="token punctuation">.</span>mountain <span class="token operator">=</span> <span class="token string">"Kosciuszko"</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<h3>Alternatives</h3>\n<p>You should not use <code>with</code> as it has subtle bugs and compatibility issues. A highly recommended approach is to assign the object to a variable, and then modify the variable’s properties. Here is an example using a larger object:</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code><span class="token keyword">let</span> earth <span class="token operator">=</span> <span class="token punctuation">{</span>\n  continents<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n    australia<span class="token punctuation">:</span> <span class="token punctuation">{</span>\n      geography<span class="token punctuation">:</span> <span class="token punctuation">{</span><span class="token punctuation">}</span>\n    <span class="token punctuation">}</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span><span class="token punctuation">;</span>\n\n<span class="token keyword">let</span> geo <span class="token operator">=</span> earth<span class="token punctuation">.</span>continents<span class="token punctuation">.</span>australia<span class="token punctuation">.</span>geography<span class="token punctuation">;</span>\n\ngeo<span class="token punctuation">.</span>ocean <span class="token operator">=</span> <span class="token string">"Pacific"</span><span class="token punctuation">;</span>\ngeo<span class="token punctuation">.</span>river <span class="token operator">=</span> <span class="token string">"Murray"</span><span class="token punctuation">;</span>\ngeo<span class="token punctuation">.</span>mountain <span class="token operator">=</span> <span class="token string">"Kosciuszko"</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<h3>Try It Out</h3>\n<p><a href="https://repl.it/Mixg/5">https://repl.it/Mixg/5</a></p>\n<h4>More Information:</h4>\n<p><a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Statements/with" target="_blank">https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Statements/with</a></p>\n<p><a href="https://yuiblog.com/blog/2006/04/11/with-statement-considered-harmful/" target="_blank">https://yuiblog.com/blog/2006/04/11/with-statement-considered-harmful/</a></p>\n<p><a href="http://2ality.com/2011/06/with-statement.html" target="_blank">http://2ality.com/2011/06/with-statement.html</a></p>',fields:{slug:"/javascript/with/"},frontmatter:{title:"With"}}},pathContext:{slug:"/javascript/with/"}}}});
